import SocialNetwork from "./SocialNetwork";
import Typewriter from "typewriter-effect";

const Home = ()=>{
    return (
        <>
            <NavBar/>
            <div className="home">
                <SocialNetwork/>
                
                <div className="info">
                    <div className="typing">
                        <Typewriter
                        asdfa
